import React, { useState, useEffect } from 'react';
import { Search, Package, AlertCircle, Loader, DollarSign, CheckCircle, XCircle } from 'lucide-react';
import { searchParts, getAvailableModels, getPartsForModel } from '../services/vandvPartsApi';

function PartsSearch() {
    const [searchTerm, setSearchTerm] = useState('');
    const [results, setResults] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [availableModels, setAvailableModels] = useState([]);

    useEffect(() => {
        // Load available models
        setAvailableModels(getAvailableModels());
    }, []);

    const handleSearch = async (e) => {
        e.preventDefault();
        if (!searchTerm.trim()) return;

        setLoading(true);
        setError('');

        try {
            const searchResults = await searchParts(searchTerm);
            setResults(searchResults);

            if (searchResults.length === 0) {
                setError('No parts found. Try searching by part number or description.');
            }
        } catch (err) {
            console.error('Search error:', err);
            setError('Error searching parts. Please try again.');
        } finally {
            setLoading(false);
        }
    };

    const loadSampleData = async () => {
        setLoading(true);
        setError('');

        try {
            // Load parts for MAV6000AWQ as sample data
            const parts = await getPartsForModel('MAV6000AWQ');
            setResults(parts.slice(0, 20)); // Show first 20 parts
            setSearchTerm('Sample: MAV6000AWQ');
        } catch (err) {
            console.error('Error loading sample data:', err);
            setError('Error loading sample data.');
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="max-w-7xl mx-auto px-4 py-8">
            <div className="mb-8">
                <h1 className="text-3xl font-bold text-gray-900 mb-4">Parts Search</h1>
                <p className="text-gray-600">
                    Search for appliance repair parts by part number or description.
                </p>

                {availableModels.length > 0 && (
                    <div className="mt-4 p-4 bg-blue-50 rounded-lg">
                        <p className="text-sm text-blue-800">
                            <strong>Currently available models:</strong> {availableModels.join(', ')}
                        </p>
                        <button
                            onClick={loadSampleData}
                            className="mt-2 text-sm text-blue-600 hover:text-blue-800 underline"
                        >
                            Load sample parts from MAV6000AWQ
                        </button>
                    </div>
                )}
            </div>

            <form onSubmit={handleSearch} className="mb-8">
                <div className="flex gap-4">
                    <div className="flex-1">
                        <input
                            type="text"
                            value={searchTerm}
                            onChange={(e) => setSearchTerm(e.target.value)}
                            placeholder="Enter part number or description..."
                            className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                        />
                    </div>
                    <button
                        type="submit"
                        disabled={loading}
                        className="px-6 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 disabled:opacity-50 disabled:cursor-not-allowed flex items-center gap-2"
                    >
                        {loading ? (
                            <Loader className="w-5 h-5 animate-spin" />
                        ) : (
                            <Search className="w-5 h-5" />
                        )}
                        Search
                    </button>
                </div>
            </form>

            {error && (
                <div className="mb-6 p-4 bg-red-50 border border-red-200 rounded-lg flex items-start gap-3">
                    <AlertCircle className="w-5 h-5 text-red-600 mt-0.5" />
                    <p className="text-red-800">{error}</p>
                </div>
            )}

            {results.length > 0 && (
                <div className="space-y-4">
                    <h2 className="text-xl font-semibold text-gray-900">
                        Found {results.length} parts
                    </h2>

                    <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-3">
                        {results.map((part, index) => (
                            <div key={`${part.partNumber}-${index}`} className="bg-white border border-gray-200 rounded-lg p-4 hover:shadow-lg transition-shadow">
                                <div className="flex items-start justify-between mb-3">
                                    <Package className="w-5 h-5 text-gray-400" />
                                    {part.stock && Object.values(part.stock).some(qty => parseInt(qty) > 0) ? (
                                        <span className="flex items-center gap-1 text-green-600 text-sm">
                                            <CheckCircle className="w-4 h-4" />
                                            In Stock
                                        </span>
                                    ) : (
                                        <span className="flex items-center gap-1 text-red-600 text-sm">
                                            <XCircle className="w-4 h-4" />
                                            Out of Stock
                                        </span>
                                    )}
                                </div>

                                <h3 className="font-semibold text-gray-900 mb-1">
                                    {part.partNumber}
                                </h3>

                                <p className="text-sm text-gray-600 mb-3 line-clamp-2">
                                    {part.partDescription}
                                </p>

                                <div className="flex items-center justify-between mb-3">
                                    <div className="flex items-center gap-1 text-green-600">
                                        <DollarSign className="w-4 h-4" />
                                        <span className="font-semibold">{part.price || 'N/A'}</span>
                                    </div>
                                    {part.listPrice && (
                                        <span className="text-sm text-gray-500 line-through">
                                            ${part.listPrice}
                                        </span>
                                    )}
                                </div>

                                {part.diagramName && (
                                    <p className="text-xs text-gray-500 mb-2">
                                        From: {part.diagramName}
                                    </p>
                                )}

                                {part.url && (
                                    <a
                                        href={part.url}
                                        target="_blank"
                                        rel="noopener noreferrer"
                                        className="text-sm text-blue-600 hover:text-blue-800"
                                    >
                                        View Details â†’
                                    </a>
                                )}
                            </div>
                        ))}
                    </div>
                </div>
            )}
        </div>
    );
}

export default PartsSearch;
